<div style="font-size:smaller">
The Apollo 11 Guidance Computer (AGC), which helped land the first humans on the Moon, had only 2KB of RAM. The software was written in assembly language, and the programmers used pointers extensively, managing to pull off this incredible feat with extremely limited resources.
</div>


